<!DOCTYPE html>
<html>
<head>
  <title>discord.js-plugins</title>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <meta property="og:url" content="https://nbopposite.github.io/discord.js-plugins/" />
  <meta property="og:title" content="Discord.js" />
  <meta property="og:description" content="Discord.js-plugins is an extension of the powerful discord.js library that enables you to organize and compartmentalize features of your bot quite easily. discord.js-plugins is not meant for managing or similar, but for keeping features that are not commands similarly organized to Commando." />
  <meta property="og:image" content="https://nbopposite.github.io/discord.js-plugins/static/logo-square.png" />
  <link rel="manifest" href="/static/manifest.json">
  <link rel="shortcut icon" type="image/x-icon" href="/discord.js-plugins/static/favicon.ico" />
  <link rel="stylesheet" type="text/css" href="//cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css" />
  <script type="text/javascript" src="//cdnjs.cloudflare.com/ajax/libs/highlight.js/9.12.0/highlight.min.js" async></script>
</head>
<body>
  <div id="app"></div>
  <!-- built files will be auto injected -->
  <script>
    if ('serviceWorker' in navigator) {
      try {
        navigator.serviceWorker.register('/sw.js');
      } catch(e) {
        console.log(e);
      }
    }
  </script>
</body>
</html>
